import React, { useState } from "react";

function End(){



    return(
        <div className="End">
            <div className="first">
                <img className="firstsvg" src="/images/01 (Stroke).svg"/>
                <p className="first text">Начинаем работать без аванса</p>
            </div>
            <div className="second">
                <img className="secondsvg" src="/images/02 (Stroke).svg"/>
                <p className="second text">Предоставляем отсрочку платежа</p>
            </div>
            <div className="third">
                <img className="secondsvg" src="/images/02 (Stroke).svg"/>
                <p className="third text">Всегда называем справедливую цену</p>
            </div>
        </div>
    );
}

export default End;
